import React from 'react'
import Common from './Common';


const About = ()=>{
  return(
    <>
            <Common name = 'Welcome to Aboute Page'
                    imgsrc = {web} visit='/contact'
                    btname="Contact Now" />
    </>
  )
}
export default About;
